import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div classNameName="navbar">
     
     <Link to="/">One</Link>
     <Link to="/two">Two</Link>
     <Link to="/three">Three</Link>
     <Link to="/four">Four</Link>
     <Link to="/five">Five</Link>

    </div>
  );
};

export default Navbar;
